import Main from "./main.jsx";


class Cardimp extends Component {
 render(){
        return ( 

            <div className="container">
            <div className="container-fluid d-flex justify-content-center">
                <div className="row">
                    <div className="col-md-6">
                        <Main imageSrc={img1} title="MobileUpdates" text={list.map((listdata, id)=>{
                            return <div>
                                Starring:{listdata.starring}
                                </div>
                        })}/>
                    </div>

                </div>
                <div className="col-md-6">
                        <Card imageSrc={img2} title="Movies" text={list.map((listdata, index)=>{
                            return <div>
                               Description: {listdata.Movie_Name}
                                </div>
                        })}/>
                    </div>
                    <div className="col-md-6">
                        <Card imageSrc={img3} title="Movies" text={list.map((listdata, index)=>{
                            return <div>
                               Description: {listdata.starring}
                                </div>
                        })}/>
                    </div>
                    </div>
                    <div className="col-md-6">
                        <Card imageSrc={img4} title="Movies" text={list.map((listdata, index)=>{
                            return <div>
                               Description: {listdata.starring}
                                </div>
                        })}/>
            </div>
            </div>
         );
    }
}

export default Cardimp;
